INSERT INTO `evaluation_table` VALUES ('1', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.2 策划', '除达到四级要求外，还应满足以下要求：\r\na) 制定服务目录的管理流程，包括服务目录管理的相关角色和职责，明确服务目录管理流程与其他流程的关系，如SLA等；\r\nb) 服务目录应包括服务列表，列表层次结构需符合GB/T 29264-2012的要求；\r\nc) 服务目录应包括服务产品的详细描述内容，如服务名称、服务简介、服务目标，以及服务对象、服务内容、服务频度、服务时间、交付方式、交付成果等；\r\nd) 建立起服务目录与运维服务业务的关联关系。', '服务目录规范性、符合性、完整性和适宜性。', 'a）服务目录应包括服务列表，需符合分类代码的要求；\r\nb）对服务基本要素需包括“目录要求”的内容，如服务产品的名称、特性描述和基本目标等；\r\nc）运维服务合同中的服务项应来自于服务目录当中，检查组织级服务目录，抽查服务合同。');
INSERT INTO `evaluation_table` VALUES ('2', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.2 策划', '除达到四级要求外，还应满足以下要求：\r\na) 运维服务团队相对独立，并建立运维管理制度；\r\nb) 服务目录有实施保障措施。', '服务团队的独立性。', 'a）检查服务目录中服务项的交付是否有相关的管理制度；\r\nb）抽查组织架构和服务管理制度，通过访谈了解：服务目录中的服务项是否能够落地实施，包括组织单位、资源以及制度等。');
INSERT INTO `evaluation_table` VALUES ('3', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.2 策划', '除达到四级要求外，还应满足以下要求：\r\na) 组织应对组织级运维服务能力管理进行策划，围绕人员、资源、技术和过程四要素进行考虑，形成组织级运维服务能力管理计划；\r\nb) 组织应建立与能力策划相适应的能力指标体系；\r\nc) 建立能力管理计划和能力指标体系的考核方法及考核准则。', 'a) 能力管理计划的适宜性和完整性；\r\nb) 能力指标体系的适宜性和完整性。', 'a）审核运维服务能力管理计划（包含人员、资源、技术和过程的相关指标）；\r\n指标体系：组织为评估服务能力管理而定义的关键指标和度量方法；\r\n保障体系：包括与服务业务和服务目录相配套的资源，以及客户投诉处理、满意度调查、客户回访、备品备件管理等制度。');
INSERT INTO `evaluation_table` VALUES ('4', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.2 策划', '除达到四级要求外，还应满足以下要求：\r\na)建立内部审核评估机制；\r\nb) 策划内部审核评估，明确审核评估团队及审核周期；\r\nc) 内部审核评估计划应覆盖运维业务相关部门及项目层。', 'a) 内部审核机制的规范性；\r\nb) 内部审核评估计划的覆盖范围。', 'a)  服务质量管理制度（包括定期服务质量评审、内部审核和服务改进制度等）；\r\nb)服务质量管理计划（包括年度的服务质量管理目标、主要活动和内审安排等）；\r\nc）需要对企业的服务质量管理机构（如质量管理部）或岗位进行审核，服务质量管理可覆盖到运维业务部门及项目层。');
INSERT INTO `evaluation_table` VALUES ('5', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.3 实施', '除达到四级要求外，还应满足以下要求：\r\na) 实施计划/方案应覆盖四要素，包括具体的任务、责任人、日程安排以及预期的目标或结果；\r\nb) 管理实施记录以验证实施过程与实施计划的一致性。', '实施计划的合理性；', 'a) 重点检查运维服务能力管理计划的实施情况，实施方案应覆盖4要素，包括：具体的任务、责任人、日程安排以及预期要达到的目标或结果；\r\nb) 通过同具体人员的沟通，确认计划与实施的一致性；\r\nc)审查运维服务能力管理计划的具体实施方案及跟踪记录；');
INSERT INTO `evaluation_table` VALUES ('6', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.3 实施', '除达到四级要求外，还应满足以下要求：\r\na) 识别与需方沟通的干系人；\r\nb) 建立与需方有效的沟通渠道，如定期访谈、邮件等；\r\nc) 建立组织级与需方的沟通制度。', '沟通协调机制的完整性、适宜性。', 'a) 审查与需方有关的组织级沟通要求和沟通记录；');
INSERT INTO `evaluation_table` VALUES ('7', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.3 实施', '除达到四级要求外，还应满足以下要求：\r\n按照服务能力管理实施计划进行实施，做好过程监督考核，重点关注运维服务能力管理计划落实的相关记录。', '实施记录的完整性。', 'a) 审查运维服务能力管理计划落实的相关记录（包括与四要素相关的报告和记录等）；\r\nb) 审查运维服务能力管理计划的实施结果或交付物的评审记录或总结报告；运维项目验收管理制度、服务质量报告（包括服务满意度报告、服务评审记录等）；');
INSERT INTO `evaluation_table` VALUES ('8', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.3 实施', '除达到四级要求外，还应满足以下要求：\r\na) 能力管理过程中的交付物满足能力质量要求；\r\nb) 服务过程中的交付物满足服务质量要求。', '交付物的完整性和符合性。', 'a) 审查运维服务能力管理计划落实的相关记录（包括与四要素相关的报告和记录等）；\r\nb) 审查运维服务能力管理计划的实施结果或交付物的评审记录或总结报告；运维项目验收管理制度、服务质量报告（包括服务满意度报告、服务评审记录等）；');
INSERT INTO `evaluation_table` VALUES ('9', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.4 检查', '除达到四级要求外，还应满足以下要求：\r\na) 组织定期评审，并保存评审记录，如评审检查表、服务过程及管理体系评审记录、内审记录等；\r\nb) 依据评审结果形成评审报告；\r\nc) 评审应覆盖全部运维服务业务。', 'a) 评审检查表对标准条款的覆盖范围；\r\nb) 评审报告的完整性；\r\nc) 评审发现的有效问题数。', 'a)  审查服务能力管理的评审和内部审核制度（包括评审检查表、服务过程及管理体系评审记录、内审记录等）；');
INSERT INTO `evaluation_table` VALUES ('10', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.4 检查', '除达到四级要求外，还应满足以下要求：\r\na) 调查需方满意度，检查运维服务能力管理计划的实施效果；\r\nb) 制定客户满意度管理制度；\r\nc) 跟踪监督运维服务能力管理计划及实施计划执行情况，并保存跟踪监督记录及效果反馈；\r\nd) 满意度调查结果形成相关报告，内容应包括满意度指标、计算方法、分析结果等。', '满意度调查制度的完整性、适宜性和有效性。', 'a) 审查对运维服务能力管理计划及实施计划执行情况的跟踪监督记录及效果反馈（前期对内部用户的满意度调查可不作为评估项）、客户满意度管理制度、客户满意度报告（包括满意度指标、计算方法、分析结果）。');
INSERT INTO `evaluation_table` VALUES ('11', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.4 检查', '除达到四级要求外，还应满足以下要求： \r\n检查能力指标体系中相关指标的落实情况，并保存记录。 ', '能力指标达成情况', '审查文档：标准条款5.2中相关指标的落实情况记录，包括“人员、资源、技术和过程的各项指标”；');
INSERT INTO `evaluation_table` VALUES ('12', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.5 改进', '除达到四级要求外，还应满足以下要求：\r\na) 建立运维服务能力管理改进机制；\r\nb) 运维服务能力管理改进机制至少包括改进流程、改进策略，以及对发现的问题和不符合项处理的相关制度；\r\nc) 运维服务能力管理计划的跟踪监督应与内审和管理评审相结合。', '改进机制的适宜性', 'a) 审查服务能力管理改进机制（包括改进流程、改进策略等）；\r\nb) 审查服务能力改进机制如何在本组织内运行。');
INSERT INTO `evaluation_table` VALUES ('13', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.5 改进', '除达到四级要求外，还应满足以下要求：\r\na) 对不符合策划要求的行为进行总结分析；\r\nb) 对运维服务能力管理实施计划的执行有偏差的部分进行总结分析；\r\nc) 对不符合项进行总结分析；\r\nd) 有预防与纠正措施的记录。', '对不符合项总结分析的有效性', 'a) 审查对运维服务能力管理计划及实施计划跟踪监督所发现问题的处理机制；内审及管理评审中对不符合项处理的相关制度；计划执行反馈问题的处理措施、不符合项总结分析、预防与纠正措施记录。');
INSERT INTO `evaluation_table` VALUES ('14', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.5 改进', '除达到四级要求外，还应满足以下要求：\r\n对未达成的指标进行调查分析，并形成报告或记录。', '对未达成指标分析的有效性。', 'a)审查针对未达成的指标调查分析报告或记录；');
INSERT INTO `evaluation_table` VALUES ('15', '1', '管理要求', 'GB/T 28827.1-2012\r\n5.5 改进', '除达到四级要求外，还应满足以下要求：\r\na) 根据分析结果确定改进措施，制定服务能力改进计划；\r\nb) 服务能力改进计划至少有能力改进项、改进目标、改进进度、责任人等；\r\nc) 保存运维服务能力管理改进过程相关记录，如改进实施方案、改进进展报告等。', 'a) 纳入改进计划的改进机会；\r\nb) 服务能力改进计划。', 'a) 审查服务能力改进计划或措施的相关制度及记录；');
INSERT INTO `evaluation_table` VALUES ('16', '1', '人员要求', 'GB/T 28827.1-2012\r\n6.2 人员管理', '除达到四级要求外，还应满足以下要求：\r\na)制定人员储备管理文件及相关计划、\r\nb)制定工作交接规范，并保存人员变更记录；\r\nc) 人员储备机制及人员储备计划需满足当前运维业务要求；\r\nd) 具备足够的人员，并满足当前运维业务需求。', 'a) 人员储备机制的适宜性；\r\nb) 人员培训体系满足运维业务的有效性；\r\nc) 人员绩效考核机制的适宜性。', 'a) 审查人员储备机制及相关计划、人员变更记录；服务质量管理人员的岗位职责说明。\r\nb) 现场抽查：人员变更记录及工作交接规范；\r\nc) 审查培训管理制度、培训需求、培训计划、培训教材、培训记录、培训成果评价。');
INSERT INTO `evaluation_table` VALUES ('17', '1', '人员要求', 'GB/T 28827.1-2012\r\n6.2 人员管理', '除达到四级要求外，还应满足以下要求：\r\na) 制定培训管理制度、保存培训记录，如培训需求、培训计划、培训课程体系及教材/课件、培训实施记录、培训效果评价；\r\nb) 培训体系或机制与运维业务相匹配；\r\nc) 识别各岗位、各级别培训要求，制定培训计划，培训内容包括管理、技术、操作及综合知识等；\r\nd) 建立培训绩效评价机制。', 'a) 人员储备机制的适宜性；\r\nb) 人员培训体系满足运维业务的有效性；\r\nc) 人员绩效考核机制的适宜性。', 'a) 审查绩效考核办法、人员绩效评价结果。\r\nb) 审查人员储备机制及相关计划、人员变更记录；服务质量管理人员的岗位职责说明。\r\nc) 现场抽查：人员变更记录及工作交接规范；\r\nd) 培训管理制度、培训需求、培训计划、培训教材、培训记录、培训成果评价。');
INSERT INTO `evaluation_table` VALUES ('18', '1', '人员要求', 'GB/T 28827.1-2012\r\n6.2 人员管理', '除达到四级要求外，还应满足以下要求：\r\na)有绩效管理办法，建立了考核体系，考核体系与运维业务相匹配；\r\n根据不同岗位制定具体的、差异化的考核指标。', 'a) 人员储备机制的适宜性；\r\nb) 人员培训体系满足运维业务的有效性；\r\nc) 人员绩效考核机制的适宜性。', 'a) 审查绩效考核办法、人员绩效评价结果。\r\nb) 审查人员储备机制及相关计划、人员变更记录；服务质量管理人员的岗位职责说明。\r\nc) 现场抽查：人员变更记录及工作交接规范；\r\nd) 培训管理制度、培训需求、培训计划、培训教材、培训记录、培训成果评价。a) 审查绩效考核办法、人员绩效评价结果。\r\nb) 审查人员储备机制及相关计划、人员变更记录；服务质量管理人员的岗位职责说明。\r\nc) 现场抽查：人员变更记录及工作交接规范；\r\nd) 培训管理制度、培训需求、培训计划、培训教材、培训记录、培训成果评价。');
INSERT INTO `evaluation_table` VALUES ('19', '1', '人员要求', 'GB/T 28827.1-2012\r\n6.3 岗位结构', '除达到四级要求外，还应满足以下要求：\r\na) 具备完整的岗位职责说明；\r\nb) 岗位设置和要求与业务和服务目录相匹配；\r\nc) 岗位职责得到有效的执行。', 'a) 岗位职责说明的完整性；\r\nb) 岗位职责执行的有效性', 'a) 审查岗位职责说明书（包括运维相关部门为运维服务提供支持的管理岗，如供应商管理、服务级别管理等）、运维项目管理制度文档；\r\nb) 访谈HR负责人，了解岗位设置和人员情况；访谈IT服务负责人，了解沟通机制的落实情况、部门协调以及标准6.3. a）.3)的落实情况；\r\nc) 审核文档：岗位职责说明书、技术岗人员编制，同HR沟通岗位职责执行情况；关键岗位备份情况；\r\nd) 审核岗位职责说明书、操作岗人员编制、主要操作岗的操作规范和手册。');
INSERT INTO `evaluation_table` VALUES ('20', '1', '人员要求', 'GB/T 28827.1-2012\r\n6.4 知识', '除达到四级要求外，还应满足以下要求：\r\na) 建立运维相关的知识体系或培训课程体系，包括运维基础、针对运维对象的专业知识与行业知识；\r\nb) 知识体系应对不同类别和级别的岗位提出相应的知识要求。', 'a) 掌握相关知识的证明文件或专业认证证书；\r\nb) 符合要求的人员数量及比例。', 'a) 审查运维相关的知识体系或培训课程体系，包括运维基础、针对运维对象的专业知识与行业知识；组织级及部门级培训计划所包含的运维课程及培训记录。');
INSERT INTO `evaluation_table` VALUES ('21', '1', '人员要求', 'GB/T 28827.1-2012\r\n6.5 技能', '除达到四级要求外，还应满足以下要求：\r\na) 制定运维人员技能级别规范，保存从业资格证书；\r\nb) 人员技能与服务目录匹配；\r\nc) 建立人员技能评价体系，人员技能与岗位要求匹配，保存技能评价记录。', 'a)运行维护服务人员技能评价体系的适宜性；\r\nb) 具备相关行业、专业资格人员的数量。', 'a) 审查运维人员能力级别规范、从业资格证书（例如ITSS资质证书）、人员技能评价体系、技能评价记录；\r\nb) 向企业HR了解运维人员能力级别的评定和职业发展情况 。');
INSERT INTO `evaluation_table` VALUES ('22', '1', '人员要求', 'GB/T 28827.1-2012\r\n6.6经验', '除达到四级要求外，还应满足以下要求：\r\na)建立人员履历、培训及其管理的相关制度；\r\nb) 人员经验与业务需求匹配，如项目人员分配，岗位职责等。', '运维人员主持或参与运行维护服务项目的项目数量、项目金额、项目规模以及在项目中的角色作用等。', 'a) 审查人员履历（包括：运维服务经验、角色、从事运维服务的项目列表）。');
INSERT INTO `evaluation_table` VALUES ('23', '1', '资源要求', 'GB/T 28827.1-2012\r\n7.2 运维工具', '除达到四级要求外，还应满足以下要求：\r\n使用运维工具对运维对象进行数据采集和监控，并重点关注以下方面：\r\na) 自有运维工具有著作权登记证书或外购工具合同；\r\nb) 运维工具至少应具有对服务结果和过程进行分析的功能；\r\nc) 运维工具有操作手册，并对使用效果进行自评估，保存自评估报告； \r\nd)工具应具备权限设置功能。', 'a) 与工具功能匹配的使用手册；\r\nb) 工具使用日志记录等；\r\nc) 工具的使用效果自评估报告；\r\nd) 工具应具备权限设置功能。', 'a) 审查自有监控工具、过程管理工具的著作权登记证书或外购工具合同（对未申请著作权的自有工具作为改进项）；对采用开源软件的工具应签署有授权协议；工具操作手册。');
INSERT INTO `evaluation_table` VALUES ('24', '1', '资源要求', 'GB/T 28827.1-2012\r\n7.2 运维工具', '除达到四级要求外，还应满足以下要求：\r\n使用运维工具对运维对象进行数据采集和监控，并重点关注以下方面：\r\na) 自有运维工具有著作权登记证书或外购工具合同；\r\nb) 运维工具至少应具有对服务结果和过程进行分析的功能；\r\nc) 运维工具有操作手册，并对使用效果进行自评估，保存自评估报告； \r\nd)工具应具备权限设置功能。', 'a) 与工具功能匹配的使用手册；\r\nb) 工具使用日志记录等；\r\nc) 工具的使用效果自评估报告；\r\nd) 工具应具备权限设置功能。', 'a) 审查根据与需方达成的服务协议，其中明确要求使用其他专用工具的，提供相关的工具使用证据');
INSERT INTO `evaluation_table` VALUES ('25', '1', '资源要求', 'GB/T 28827.1-2012\r\n7.3 服务台', '除达到四级要求外，还应满足以下要求：\r\n建立、使用和管理服务台，并重点关注以下方面：\r\na) 制定服务台的职能说明、服务台管理制度、服务流程、操作手册，并保存用户评价记录；\r\nb) 建立服务请求的流程，包括服务请求的操作规程、跟踪和反馈方法；\r\nc) 建立用户评价记录产生的流程、主要内容、评价结果与考核的关系；\r\nd) 监督管理服务台的日常工作。', 'a) 日常工作记录的完整性；\r\nb) 用户评价记录的完整性。', 'a) 审查服务台职能说明、服务台管理制度、服务流程、操作手册、用户评价记录。\r\nb) 现场抽查：服务台记录（包括工作日志、服务请求和处理记录等），了解用户对服务台人员的反馈。');
INSERT INTO `evaluation_table` VALUES ('26', '1', '资源要求', 'GB/T 28827.1-2012\r\n7.4备件库', '根据服务目录及服务级别协议，对于其中明确要求提供备品备件的，应建立备件库，并要求：\r\na) 制定备件库管理规范，包括：备件响应方式和级别定义、备品备件的数量和类型、类别与编码、存放环境，以上内容均能够满足SLA所要求的备件支持；\r\nb) 制定备件采购计划或方案，包括采购人员职责、采购流程、库存策略、紧急采购预案等。制定供应商管理制度，至少每年对供应商进行一次评估；\r\nc) 制定出入库制度，包括送货、验收、入库、出库等的流程，并实施，具有备件库存管理的记录或报告；\r\nd) 制定备件的检测、报废制度，能定期对备件状态进行检测，以确保其功能满足运维需求。对涉及国家强制规定检定设备须送专业机构检测并获得检测报告。', 'a) 备件库信息完整性、准确性和真实性；\r\nb) 备件管理规范的适用性；\r\nc) 备件库出入库管理制度的适用性；\r\nd) 备件可用率。', 'a)  审查备件库管理规范、出入库记录、检测报告、采购单；\r\nb) 现场抽查：可对备件库进行现场检查；\r\n由需方、外包方或第三方进行备件管理的，应提供其备件管理有效性的证据。');
INSERT INTO `evaluation_table` VALUES ('27', '1', '资源要求', 'GB/T 28827.1-2012\r\n7.5 知识库', '除达到四级要求外，还应满足以下要求：\r\n建立、管理和使用知识库，并重点关注以下方面：\r\na) 知识库内容至少应包括针对已知错误和问题的描述、分析和解决方法；\r\nb) 知识库可共享给整个组织，并提供有效方式访问方式；\r\nc) 具有知识管理策略，包括知识来源、类别、共享范围、更新升级、传播方式等。\r\nd) 制定知识库使用手册，并保留知识维护记录（添加、更新等）；\r\ne) 制定知识管理和使用制度，对知识库进行生命周期管理，知识管理的角色应落实到具体人员。', 'a) 知识库的覆盖范围；\r\nb) 知识库的可用性和有效性；\r\nc) 入库管理和审批记录的有效性。', 'a) 审查自有知识库管理工具软件的著作权登记证书或外购知识库合同（对未申请著作权的自有工具作为改进项）；\r\nb) 组织自有的知识库允许不办理著作权登记证书，但应进行现场展示，其内容至少应包括已知错误和问题。\r\nc) 知识库系统，了解知识库的访问和共享方式\r\nd）审查知识管理策略（包括知识来源、共享范围、更新升级、传播方式等）\r\ne）审查知识库使用手册和知识维护（添加、更新等）记录。\r\nF）知识管理和使用制度；知识库与相关文档的符合性。\r\n知识管理的角色应落实到具体人员。');
INSERT INTO `evaluation_table` VALUES ('28', '1', '技术要求', 'GB/T 28827.1-2012\r\n8.2 技术研发', '除达到四级要求外，还应满足以下要求：\r\n制定详细的运维服务技术研发规划并得到实施，重点关注以下方面：\r\na) 运维技术研发应与业务发展匹配；\r\nb) 根据业务及市场分析，制定研发规划文件，规划文件应包括当前技术的发展动态分析、拟关注的重点方向、拟研发的技术与业务的关联程度等内容；\r\nc) 研发规划得到实施，具备与规划相适应的研发组织结构和人员数量、研发经费投入、研发环境以及研发成果等。', 'a) 研发投入经费；\r\nb) 研发成果数量；\r\nc) 技术研发规划文件内容的完整性。', 'a）审查研发规划文件（包括当前技术的发展动态分析、拟关注的重点方向、拟研发的技术与业务的关联程度等），研发队伍组织结构和人员数量，研发经费投入，研发成果数量\r\nb）现场抽查：实际研发环境和研发成果\r\n注：技术是指与服务产品或运维相关的技术，可以是方法、手段、工具链。');
INSERT INTO `evaluation_table` VALUES ('29', '1', '技术要求', 'GB/T 28827.1-2012\r\n8.3与发现问题相关的技术', '除达到四级要求外，还应满足以下要求：\r\n拥有与发现问题相关的技术，并重点关注以下方面：\r\na) 拥有核心的运维服务工具，为运维数据的信息采集、监控提供支撑，并配备信息采集和监控技术的说明文件；\r\nb) 对问题的诊断和分析有较完备的流程体系，例如能够借助知识库解决问题等；\r\nc) 有效利用诊断方案和分析手册。', 'a) 信息采集手段的可用性和使用便捷性；\r\nb) 诊断方案或手册的有效性。', 'a）审查信息采集和监控技术的说明文件、诊断和分析问题的知识记录文档；至少要有对典型故障或问题进行分析诊断的操作流程。');
INSERT INTO `evaluation_table` VALUES ('30', '1', '技术要求', 'GB/T 28827.1-2012\r\n8.4 与解决问题相关的技术', '除达到四级要求外，还应满足以下要求：\r\n拥有与解决问题相关的技术，并重点关注以下方面：\r\na) 建立系统/设备处于正常状态的指标体系；\r\nb) 有测试环境、测试标准和方法；\r\nc) 有典型故障和问题的解决方案和操作手册，并得到有效利用。', 'a) 解决问题的技术指标或标准的有效性；\r\nb) 测试环境与需方运行维护环境的匹配度；\r\nc) 测试标准和方法的有效性。', 'a）审查系统或设备处于正常状态的指标体系文档审查，问题解决方案或操作手册，测试标准和方法相关文档，至少要有对典型故障或问题进行排除解决的操作流程。');
INSERT INTO `evaluation_table` VALUES ('31', '1', '过程要求', 'GB/T 28827.1-2012\r\n9.2 服务级别管理', '除达到四级要求外，还应满足以下要求：\r\n确保供方定义、签订和管理SLA，满足需方对服务质量的要求，并重点关注以下方面：\r\na) 建立SLA考核自评估机制，具有服务级别协议的执行绩效跟踪记录，如SLA完成情况、达成率、用户反馈等，在评估后制定改进内容及改进措施；\r\nb) 服务级别协议中应包含量化指标，如响应时间、解决问题的时间等。', 'a) 签订SLA文件的规范性；\r\nb) SLA考核评估机制的有效性和完整性；\r\nc) SLA执行的有效性。', 'a) 审查服务级别管理过程、项目服务目录及服务级别协议（包括必要的量化指标）、服务级别协议的执行绩效跟踪文档；\r\nb) 现场抽查： 具体项目的服务级别协议或合同、项目实施案例，检查服务级别协议内容是否达成；');
INSERT INTO `evaluation_table` VALUES ('32', '1', '过程要求', 'GB/T 28827.1-2012\r\n9.3 服务报告', '除达到四级要求外，还应满足以下要求：\r\na) 制定服务报告的管理规范，并对服务报告内容、产生频次、审核要求、传播和保存等做出说明；\r\nb)服务报告内容应完备，至少包括运维服务相关的基本要素，如与SLA相对的服务绩效、满意度分析、工作量、重大事件后的性能分析、趋势分析、未达标的内容和事件，并针对不同运维服务内容提供服务报告模板；\r\nc) 及时跟进和解决服务报告中提出的问题；\r\nd) 服务报告计划需满足SLA的约定或供方的制度。服务报告计划可多种形式；\r\ne) 服务报告应进行有效的分类。', 'a) 服务报告管理过程的规范性；\r\nb) 服务报告的完整性、及时性和准确性。', 'a) 审查服务报告管理过程、服务报告计划、服务报告模板；服务报告；\r\nb) 现场抽查：项目实施案例；了解\r\n1、服务报告内容是否完备（服务报告内容应包括与运维服务相关的基本要素，例如：与SLA相对的服务绩效、满意度分析、工作量、重大事件后的性能分析、趋势分析、未达标的内容和事件）\r\n2、服务报告中的问题是否得到跟进或解决。');
INSERT INTO `evaluation_table` VALUES ('33', '1', '过程要求', 'GB/T 28827.1-2012\r\n9.4 事件管理', '除达到四级要求外，还应满足以下要求：\r\na) 具备事件管理工具，制定事件记录模板，保存事件记录、事件回访记录和事件管理报告；\r\nb) 建立事件或故障分类分级机制，并保持与组织业务相适应。\r\nc) 建立事件升级机制；\r\nd) 建立事件评估机制，包括事件解决率、事件平均解决时间等', 'a) 事件管理过程的完整性、有效性；\r\nb) 事件解决评估机制的有效性；\r\nc) 事件升级机制的有效性。', 'a） 审查事件管理过程（包括事件分类、分级和升级机制）；事件记录模板、事件记录、事件回访记录、事件管理报告（如服务报告中对事件解决的相关数据：如事件解决率、事件响应时间、事件解决时间等量化指标； 对事件处理情况的趋势分析；事件处理与SLA的关联分析；事件解决与服务人员绩效考核相关联）；');
INSERT INTO `evaluation_table` VALUES ('34', '1', '过程要求', 'GB/T 28827.1-2012\r\n9.5 问题管理', '除达到四级要求外，还应满足以下要求：\r\na) 建立与问题管理过程一致的活动，包括问题建立、分类、调查和诊断、关闭等；\r\nb) 建立有效的问题解决评估机制，包括问题解决率、问题平均解决时间等；\r\nc) 有支撑问题管理活动和结果的问题记录文档、问题管理报告等，并与知识库关联。', 'a) 问题管理过程的完整性；\r\nb) 问题解决评估机制有效性。', 'a) 审查问题管理过程；问题记录模板、问题管理报告，问题管理过程手册要满足：\r\n流程在项目中的实施应体现对问题识别的合理机制，问题记录应完整；问题可关联到知识库。\r\nb）现场抽查：项目实施案例、访问知识库。');
INSERT INTO `evaluation_table` VALUES ('35', '1', '过程要求', 'GB/T 28827.1-2012\r\n9.6 配置管理', '除达到四级要求外，还应满足以下要求：\r\n供方应根据配置管理的过程要求：\r\na) 建立与业务相适应的配置管理数据库；\r\nb) 建立配置管理规范、配置管理数据库管理规范、配置管理记录。', 'a) 配置管理活动的完整性；\r\nb) 配置数据的准确、完整、有效、可用和可追溯；', 'a）审查文档：配置管理过程，包括：\r\n配置管理规范、配置管理记录；\r\n配置管理数据库管理规范；\r\n配置项审计规范、配置审计记录等。\r\nb）现场展示配置管理数据库，CMDB 应包括配置项的基本信息。');
INSERT INTO `evaluation_table` VALUES ('36', '1', '过程要求', 'GB/T 28827.1-2012\r\n9.7 变更管理', '除达到四级要求外，还应满足以下要求：\r\n供方通过管理、控制变更的过程，确保变更有序实施。供方应根据变更管理的过程要求，实现以下方面：\r\na)定义变更类型，建立变更范围管理机制，明确变更审批负责人或变更审批委员会；\r\nb) 制定变更管理规范，保存变更管理记录，包括变更申请单、审批记录、变更管理报告等；', 'a) 变更管理过程的完整性；\r\nb) 变更记录的完整性。', 'a) 审查文档：变更管理过程、变更管理记录、变更管理报告；');
INSERT INTO `evaluation_table` VALUES ('37', '1', '过程要求', 'GB/T 28827.1-2012\r\n9.8发布管理', '除达到四级要求外，还应满足以下要求：\r\n制定发布管理规范，保存发布过程记录，包括：发布计划、测试方案、回退方案、发布记录、发布评估报告等。', 'a) 发布管理过程的完整性；\r\nb) 发布过程记录的完整性。', 'a) 审查文档：发布管理流程、发布计划、发布方案、发布记录、发布评估报告等；\r\nb) 现场抽查：发布管理报告。');
INSERT INTO `evaluation_table` VALUES ('38', '1', '过程要求', 'GB/T 28827.1-2012\r\n9.9 信息安全管理', '除达到四级要求外，还应满足以下要求：供方应建立运行维护服务过程中的信息安全管理过程，并重点关注以下方面：\r\na) 建立信息安全管理过程，包括安全方针、策略等，并对信息安全风险进行识别、评估、处置和改进，形成相关记录，如信息安全控制措施及风险评估记录、实施记录等；\r\nb) 建立与组织业务相适应的信息安全事件处理流程。', 'a) 信息安全培训的有效性；\r\nb) 信息安全事件处理记录的有效性。', 'a) 审查文档：信息安全管理过程（包括安全方针、策略等）、风险评估记录、信息安全控制措施及实施记录。\r\n\r\n应重点关注保护需方信息资产的安全措施。');
